import React from "react";

class App extends React.Component {
  render() {
    return (
      <nav className="navbar navbar-expand-lg navbar-dark bg-light">
        <div className="container-fluid">
          <a className="navbar-brand" href="#">FilmMe</a>
        </div>
      </nav>
    );
  }
}

export default App;
